// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/ITradingAccount.sol";

contract AccountRegistry is Ownable {
    event AccountCreated(address indexed owner, address indexed account);

    address public immutable weth;
    address public immutable usdc;
    address public immutable uniswapV2Pair;
    address public immutable cETH;
    address public immutable cUSDC;
    address public immutable comptroller;
    address public immutable priceFeed;
    address public immutable accountTemplate;
    mapping(address => address) public getAccount;

    constructor(
        address weth_,
        address usdc_,
        address uniswapV2Pair_,
        address cETH_,
        address cUSDC_,
        address comptroller_,
        address priceFeed_,
        address accountTemplate_
    ) Ownable(msg.sender) {
        weth = weth_;
        usdc = usdc_;
        uniswapV2Pair = uniswapV2Pair_;
        cETH = cETH_;
        cUSDC = cUSDC_;
        comptroller = comptroller_;
        priceFeed = priceFeed_;
        accountTemplate = accountTemplate_;
    }

    function createAccount() external returns (address) {
        require(getAccount[msg.sender] == address(0), "account exists");
        address account = Clones.clone(accountTemplate);
        ITradingAccount(account).initialize(
            msg.sender,
            weth,
            usdc,
            uniswapV2Pair,
            cETH,
            cUSDC,
            comptroller,
            priceFeed
        );
        getAccount[msg.sender] = account;
        emit AccountCreated(msg.sender, account);
        return account;
    }
}

contracts/interfaces/ITradingAccount.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// import "@openzeppelin/contracts/access/Ownable.sol";

interface ITradingAccount {
    event Deposit(bool isETH, uint256 account, uint256 cTokenAmount);
    event Withdraw(bool isETH, uint256 cTokenAmount, uint256 underlyingAmount);

    // 開多
    event OpenLong(uint256 ethSize, uint256 cTokenMint, uint256 borrowAmount);  

    // 開空
    event OpenShort(uint256 usdcSize, uint256 cTokenMint, uint256 borrowAmount);    

    // 平多
    event CloseLong(    
        uint256 redeemCTokenAmount,
        uint256 redeemUnderlyingAmount,
        uint256 repayAmount,
        bool closeAll
    );

    // 平空
    event CloseShort(   
        uint256 redeemCtokenAmount,
        uint256 redeemUnderlyingAmount,
        uint256 repayAmount,
        bool closeAll
    );

    // 限價單開多
    event LimitOpenLong(    
        uint256 orderId,
        uint256 ethSize,
        uint256 limitPrice,
        uint256 expireAt,
        address indexed keeper
    );

    // 限價單開空
    event LimitOpenShort(
        uint256 orderId,
        uint256 usdcSize,
        uint256 limitPrice,
        uint256 expireAt,
        address indexed keeper
    ); 

    // 取消限價單
    event CancelLimitOrder(uint256 orderId);   

    // 執行限價單, 由指定的keeper觸發
    event ExecuteLimitOrder(uint256 orderId, uint256 dealPrice);   

    struct LimitOrder {
        bool isLong;
        bool isCanceled;
        uint256 openSize;
        uint256 limitPrice;
        uint256 dealPrice;
        uint256 expireAt;
        uint256 keeper;
    }

    function initialize(
        address owner,
        address weth,
        address usdc,
        address uniswapV2Pair,
        address cETH,
        address cUSDC,
        address comptroller,
        address priceFeed
    ) external;
}

